import { useEffect, useState } from "react";

export default function HostCarInfo() {
    const [car, setCar] = useState(0);
    useEffect(() => {
        const res = JSON.parse(localStorage.getItem("cars"));
        const data = res.filter(c => c.id === "1" && c.hostId === "1");
        setCar(data[0]);
    }, []);

    return (
      <div>
        <p><strong>Name: </strong>{ car.name }</p>
        <p><strong>Category: </strong>{ car.type }</p>
        <p style={{maxWidth: 500}}><strong>Description: </strong>{ car.description }</p>
        <p style={{marginBottom: 100}}><strong>Visibilty: </strong>Public</p>
      </div>
    );
};
